import React from "react";
import '../FormStyling.css';
function FieldTypeInput(props) {

    let config = props.config;

    return (<div>
        <label>{config.Text}</label>
        <p><input type={config.type} placeholder={config.Text} /></p>
    </div>
    );
}

export default FieldTypeInput;
